export default (function(a,b,c,d,e,f,g,h,i,j,k,l,m){return {data:{u3qwMlIXJJ:{id:"iul7_2w-c",createdAt:c,updatedAt:d,publishedAt:c,revisedAt:d,title:"Initial Post",category:[{id:e,createdAt:a,updatedAt:b,publishedAt:a,revisedAt:b,name:f}],body:"\u003Ch2 id=\"h34ae273933\"\u003Eテスト投稿\u003C\u002Fh2\u003E\u003Cp\u003E私はその人を常に先生と呼んでいた。だからここでもただ先生と書くだけで本名は打ち明けない。これは世間を憚かる遠慮というよりも、その方が私にとって自然だからである。私はその人の記憶を呼び起すごとに、すぐ「先生」といいたくなる。筆を執っても心持は同じ事である。よそよそしい頭文字などはとても使う気にならない。私が先生と知り合いになったのは鎌倉である。その時私はまだ若々しい書生であった。暑中休暇を利用して海\u003C\u002Fp\u003E",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F994aa8eb00d34f9a80fd3f955c1aa0a4\u002F3d26226cfb9442a8962e83427b5523a0\u002Fsample01.jpg",height:329,width:499}},"4ys91waZ6w":{contents:[{id:"cat05",createdAt:g,updatedAt:h,publishedAt:g,revisedAt:h,name:"CAT05"},{id:"cat04",createdAt:i,updatedAt:"2022-12-23T07:21:13.425Z",publishedAt:i,revisedAt:"2022-12-23T07:21:02.411Z",name:"CAT04"},{id:"cat03",createdAt:j,updatedAt:k,publishedAt:j,revisedAt:k,name:"CAT03"},{id:"cat02",createdAt:l,updatedAt:m,publishedAt:l,revisedAt:m,name:"CAT02"},{id:e,createdAt:a,updatedAt:b,publishedAt:a,revisedAt:b,name:f}],totalCount:5,offset:0,limit:100}},prerenderedAt:1672118796521}}("2022-12-23T06:35:22.255Z","2022-12-23T07:22:00.602Z","2022-12-15T02:12:07.425Z","2022-12-23T08:21:32.445Z","cat01","CAT01","2022-12-23T06:36:20.523Z","2022-12-23T07:20:40.694Z","2022-12-23T06:36:11.113Z","2022-12-23T06:36:00.254Z","2022-12-23T07:21:29.778Z","2022-12-23T06:35:47.950Z","2022-12-23T07:21:45.603Z"))